const Navbar = () => {
  return (
    <nav
      id="navbar"
      className="min-w-full bg-gray-900 text-orange-50 min-h-[6rem]"
    >
      <ul className="flex flex-row gap-[3rem] justify-end content-center">
        <li className="m-auto">Leaderboard</li>
        <li className="m-auto">IDK THA</li>
        <li className="m-auto">WHATEVER</li>
      </ul>
    </nav>
  );
};

export default Navbar;
